import React from "react";
import  Github  from "../../assets/iconComponents/Github";
function Project({  name, stack, live, source,  }) {
  const projects = [
    {
      name: "Weather Dashboard",
      stack: "HTML, CSS, Javascript",
      link: "https://miklywek.github.io/weather-dashboard/",
    },
    {
      name: "Work Day Scheduler",
      stack: "jQuery Bootstrap",
      link: " https://miklywek.github.io/work-day-scheduler/",
    },
    {
      name: "Just Tech News",
      stack: "Node",
      link: "https://github.com/miklywek/just-tech-news",
    },
    {
      name: "Dream Trip",
      stack: "Node, Express, MySQL, Sequelize ORM, ",
      link: "https://github.com/miklywek/dream-trip",
    },
  ];

  return (
    <div className="">
      {projects.map((project) => (
        <div className="card mb-5" style={{ maxWidth: "900px" }}>
          <div className="g-0 d-flex flex-column flex-lg-row align-items-center ">
            <div className="">
              <div className="card-body">
                <h5 className="card-title">{project.name}</h5>
                <div className="mt-5 align-text-bottom">
                  <p className="card-text">{project.stack}</p>
                  <p className="card-text d-flex gap-4">

                    <a
                      href={project.link}
                      target="_blank"
                      rel="noreferrer"
                      className="link"
                    >
                      Source Code <Github/> {"project.link "}



                    </a>
                  </p>
                </div>
              </div>
            </div>
          </div>
        </div>
      ))}
    </div>
  );
}

export default Project;
